sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	if (inputs.status_code == '200') {
		try {
			var link = JSON.parse(inputs.response).screening_results_url;
			if (link != '') {
				outputs.status = "Success";
				outputs.report_link = link;
			} else
				outputs = new FirstAdvantageSpokeErrorHandler()
				.getOrderReportByOrderID(inputs, outputs);
		} catch (e) {
			outputs = new FirstAdvantageSpokeUtils().setErrorMessage(
				outputs);
		}
	} else
		outputs = new FirstAdvantageSpokeErrorHandler()
		.getOrderReportByOrderID(inputs, outputs);
})(inputs, outputs);

